export const SIGNAL_SERVER = 'ws://localhost:8080';

export const createPeerConnection = () => {
  const peer = new RTCPeerConnection({
    iceServers: [{ urls: 'stun:stun.l.google.com:19302' }]
  });
  return peer;
};
